package bd.edu.seu.messmanagmentsystem.model;import lombok.AllArgsConstructor;import lombok.Data;import lombok.NoArgsConstructor;import javax.persistence.Entity;import javax.persistence.GeneratedValue;import javax.persistence.GenerationType;import javax.persistence.Id;import java.time.LocalDate;@Data@AllArgsConstructor@NoArgsConstructor@Entitypublic class Meal {    @Id    @GeneratedValue(strategy = GenerationType.AUTO)    private long mealId;    private long member_id;    private double breakfast;    private double launch;    private double dinner;    private LocalDate date;}